using namespace std;

/* constant */

const int MAX_N = 100;
const int MAX_M = 100;
const int BN = 256;

/* typedef */

typedef bitset<BN> bb;
typedef map<string,int> msi;

/* global variables */

bb vrs[MAX_M];
msi vmap;

/* subroutines */

/* main */

int main() {
  int m;
  cin >> m;

  for (int i = 0; i < m; i++) {
    string name;
    int lb, ub;
    cin >> name >> lb >> ub;

    vrs[i].reset();
    for (int j = lb; j <=ub; j++) vrs[i].set(j);
    vmap[name] = i;
  }

  int n;
  cin >> n;

  stack<bb> st;
  bool ok = true;

  for (int i = 0; i < n; i++) {
    string e;
    cin >> e;

    msi::iterator mit = vmap.find(e);
    if (mit != vmap.end())
      st.push(vrs[mit->second]);
    else if (e[0] < '0' || e[0] > '9') {
      bb b = st.top(); st.pop();
      bb a = st.top(); st.pop();
      bb r(0);

      for (int bi = 0; bi < BN; bi++) {
	if (! b.test(bi)) continue;

	if (bi == 0 && e[0] == '/') {
	  ok = false;
	  break;
	}

	for (int ai = 0; ai < BN; ai++) {
	  if (! a.test(ai)) continue;

	  int ri;
	  if (e[0] == '+') ri = (ai + bi) % BN;
	  else if (e[0] == '-') ri = (ai + BN - bi) % BN;
	  else if (e[0] == '*') ri = (ai * bi) % BN;
	  else ri = (ai / bi) % BN;

	  r.set(ri);
	}
      }
      if (! ok) break;

      st.push(r);
    }
    else {
      int k = atoi(e.c_str());
      bb r(0);
      r.set(k);
      st.push(r);
    }
  }

  cout << (ok ? "correct" : "error") << endl;
  return 0;
}

