//[l, r] wo merge
set<pii> mergeSegment(const set<pii>& st) {
	set<pii> ret;
	if(st.size() == 0) return ret;
	auto p = *st.begin();
	auto it = st.begin();
	it++;
	while(it != st.end()) {
		auto tmp = *it;
		if(p.se+1 >= tmp.fi) {
			p.fi = min(p.fi, tmp.fi);
			p.se = max(p.se, tmp.se);
		}
		else{
			ret.insert(p);
			p = tmp;
		}
		it++;
	}
	ret.insert(p);
	return ret;
}
stack<set<pii>> st;

void plus_st_pii(set<pii> A, set<pii> B){
	set<pii> ret;
	for(auto a : A) {
		for(auto b : B) {
			pii p;

			p.fi = (a.fi + b.fi)%256;
			p.se = (a.se + b.se)%256;
			if(p.se < p.fi) {
				ret.insert({0, p.se});
				ret.insert({p.fi, 255});
			}
			else ret.insert(p);
		}
	}
	ret = mergeSegment(ret);
	st.push(ret);
}

void minus_st_pii(set<pii> A, set<pii> B) {
	set<pii> ret;
	for(auto a : A) {
		for(auto b : B) {
			pii p;
			p.fi = (a.fi - b.se + 256) % 256;
			p.se = (a.se - b.fi + 256) % 256;
			if((a.fi - b.se < 0) ^ (a.se - b.fi < 0)) {
				ret.insert({0, min(p.fi, p.se)});
				ret.insert({max(p.fi, p.se), 255});
			}
			else if(p.se < p.fi) {
				ret.insert({0, p.se});
				ret.insert({p.fi, 255});
			}
			else ret.insert(p);
		}
	}
	ret = mergeSegment(ret);
	st.push(ret);
}

