			// else ret.insert(p);
			REP(aa, a.fi, a.se+1) {
				REP(bb , b.fi, b.se+1) {
					ret.insert({aa*bb%256,aa*bb%256});
				}
			}
		}
	}
	ret = mergeSegment(ret);
