}

bool div_st_pii(set<pii> A, set<pii> B) {
	set<pii> ret;
	for(auto a : A) {
		for(auto b : B) {
			if(b.fi == 0) return false;
			pii p;
			p.fi = (a.fi / b.se)%256;
			p.se = (a.se / b.fi)%256;
			if(p.se < p.fi) {
				ret.insert({0, p.se});
				ret.insert({p.fi, 255});
			}
			else ret.insert(p);
		}
	}
	ret = mergeSegment(ret);
	st.push(ret);
	return true;
}

