int stoi(string x){
  int r=0;
  for(int i=0;i<x.size();i++){
    r *= 10; r += x[i]-'0';
  }
  return r;
}

inline int cal(int a,int b,string op){
  int res;
  if(op == "+")res = a+b;
  else if(op == "-")res = a-b;
  else if(op == "*")res = a*b;
  else res = a/b;
  return (res + 256) % 256;
}

