    if (s[0] == '+') {
        ret = calc(0);
    } else if (s[0] == '-') {
        ret = calc(1);
    } else if (s[0] == '*') {
        ret = calc(2);
    } else if (s[0] == '/') {
        ret = calc(3);
    } else {
        q.push_back(s);
    }
    return ret;
}

