            for(int j = 0;j < 256;j++){
                if(arg1[i] && arg2[j]){
                    res[(i+j)%256] = true;
                }
            }
        }
        return res;
    }
    if(op == "-"){
        for(int i = 0;i < 256;i++){
            for(int j = 0;j < 256;j++){
                if(arg1[i] && arg2[j]){
                    res[(i-j+256)%256] = true;
                }
            }
        }
        return res;
    }
    if(op == "*"){
        for(int i = 0;i < 256;i++){
            for(int j = 0;j < 256;j++){
                if(arg1[i] && arg2[j]){
                    res[(i*j)%256] = true;
                }
            }
        }
        return res;
    }
    if(op == "/"){
        for(int i = 0;i < 256;i++){
            for(int j = 0;j < 256;j++){
                if(arg1[i] && arg2[j]){
                    if(j == 0){
                        throw ZeroDivisionError();
                    }
                    res[(i/j)%256] = true;
                }
            }
        }
        return res;
    }
    throw ParseError();
}

