#include <bits/stdc++.h>
using namespace std;

constexpr int MAX_N = 256;
using E = array<bool, MAX_N>;

map<string,E> table;
bool error = false;

E add(E a, E b){
    E res;
    res.fill(false);
    for(int i=0;i<MAX_N;i++){
        for(int j=0;j<MAX_N;j++){
            if(a[i]&&b[j]){
                res[(i+j)%MAX_N] = true;
            }
        }
    }
    return res;
}

E sub(E a, E b){
    E res;
    res.fill(false);
    for(int i=0;i<MAX_N;i++){
        for(int j=0;j<MAX_N;j++){
            if(a[i]&&b[j]){
                res[(i-j+MAX_N)%MAX_N] = true;
            }
        }
    }
    return res;
}

E mul(E a, E b){
    E res;
    res.fill(false);
    for(int i=0;i<MAX_N;i++){
        for(int j=0;j<MAX_N;j++){
            if(a[i]&&b[j]){
                res[(i*j)%MAX_N] = true;
            }
        }
    }
    return res;
}

E div(E a, E b){
    if(b[0]) error = true;
    E res;
    res.fill(false);
    for(int i=0;i<MAX_N;i++){
        for(int j=1;j<MAX_N;j++){
            if(a[i]&&b[j]){
                res[(i/j)%MAX_N] = true;
            }
        }
    }
    return res;
}

int solve(){
    int m, n;
    cin >> m;
    for(int i=0;i<m;i++){
        string name;
        int l, u;
        cin >> name >> l >> u;
        E var;
        var.fill(false);
        for(int j=l;j<=u;j++){
            var[j] = true;
        }
        table[name] = var;
    }
    stack<E> s;
    cin >> n;
    for(int i=0;i<n;i++){
        string e;
        cin >> e;
        if(isdigit(e.front())){
            int x = stoi(e);
            E num;
            num.fill(false);
            num[x] = true;
            s.push(num);
        }else if(isalpha(e.front())){
            E var = table[e];
            s.push(var);
        }else{
            E a, b;
            b = s.top(); s.pop();
            a = s.top(); s.pop();
            if(e == "+"){
                s.push(add(a,b));
            }else if(e == "-"){
                s.push(sub(a,b));
            }else if(e == "*"){
                s.push(mul(a,b));
            }else{
                s.push(div(a,b));
            }
        }
    }
    cout << (error ? "error" : "correct") << endl;
    return 0;
}

