#include <bits/stdc++.h>

using namespace std;

#define MAX 500
typedef pair<int, int> pii;

int n;
vector<string> e;
map<string, pii> mp;

int op_num(char c)
{
    switch (c) {
        case '+':
            return 0;
        case '-':
            return 1;
        case '*':
            return 2;
        case '/':
            return 3;
    }
    return -1;
}

int s2i(string &s)
{
    int res;
    stringstream ss(s);
    ss >> res;
    return res;
}

int memo[MAX][MAX];

bool zero_division_checker(int x, stack<int> st)
{
    if (x == n) {
        return true;
    }
    int v = (st.empty() ? n : st.top());
    if (memo[x][v] != -1) {
        return memo[x][v];
    }
    bool res = 1;
    if (isdigit(e[x][0])) {
        st.push(s2i(e[x]));
        res = zero_division_checker(x+1, st);
        st.pop();
    } else {
        int op = op_num(e[x][0]);
        if (op >= 0) {
            int b = st.top(); st.pop();
            int a = st.top(); st.pop();
            if (op == 0) {
                a = (a + b) % 256;
            } else if (op == 1) {
                a = (a - b + 256) % 256;
            } else if (op == 2) {
                a = (a * b) % 256;
            } else {
                if (b == 0) {
                    return false;
                }
                a = (a / b) % 256;
            }
            st.push(a);
            res &= zero_division_checker(x+1, st);
        } else {
            pii p = mp[e[x]];
            for (int i = p.first; i <= p.second; i++) {
                st.push(i);
                res &= zero_division_checker(x+1, st);
                st.pop();
            }
        }
    }
    return memo[x][v] = res;
}

int main()
{
    int m;
    cin >> m;
    string name;
    int lb, ub;
    for (int i = 0; i < m; i++) {
        cin >> name >> lb >> ub;
        mp[name] = pii(lb, ub);
    }
    cin >> n;
    e.resize(n);
    for (int i = 0; i < n; i++) {
        cin >> e[i];
    }
    memset(memo, -1, sizeof(memo));
    cout << (zero_division_checker(0, stack<int>()) ? "correct" : "error") << endl;
    return 0;
}

