Number operator + (const Number &lhs, const Number &r
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    ret.cand.push_back((lhs.cand[i] + rhs.cand[j]) %
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.
  }
  return ret;
}

Number operator - (const Number &lhs, const Number &r
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    ret.cand.push_back((lhs.cand[i] - rhs.cand[j] + 2
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.
  }
  return ret;
}

Number operator * (const Number &lhs, const Number &r
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    ret.cand.push_back((lhs.cand[i] * rhs.cand[j]) %
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.
