            elem A=S.top();S.pop();
            elem C;
            for(int a=0;a<256;a++){
                if(A.isPossible[a]==false) continue;
                for(int b=0;b<256;b++){
                    if(B.isPossible[b])C.isPossible[(a-b)&0b11111111]=true;
                }
            }
            S.push(C);
            continue;
        }
        if(str[0]=='*'){
            elem B=S.top();S.pop();
            elem A=S.top();S.pop();
            elem C;
            for(int a=0;a<256;a++){
                if(A.isPossible[a]==false) continue;
                for(int b=0;b<256;b++){
                    if(B.isPossible[b])C.isPossible[(a*b)&0b11111111]=true;
                }
            }
            S.push(C);
            continue;
        }
        if(str[0]=='/'){
            elem B=S.top();S.pop();
            elem A=S.top();S.pop();
