set<int> calc(set<int> a,set<int> b,string op)
{
	set<int> s;
	for(int x:a) for(int y:b){
		switch(op[0]){
		case '+': s.insert((x+y)%256);     break;
		case '-': s.insert((x-y+256)%256); break;
		case '*': s.insert((x*y)%256);     break;
		case '/': if(y==0) throw "error"; else s.insert(x/y);
		}
	}
	return s;
}

