set<int> operator + (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A+B)%256);
		}
	}
	return C;
}
set<int> operator / (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A/B)%256);
		}
	}
	return C;
}

set<int> operator * (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A*B)%256);
		}
	}
	return C;
}

set<int> operator - (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A-B+256)%256);
		}
	}
	return C;
}



