    }
    cin >> n;
    e.resize(n);
    for (int i = 0; i < n; i++) {
        cin >> e[i];
    }
    memset(memo, -1, sizeof(memo));
    cout << (zero_division_checker(0, stack<int>()) ? "correct" : "error") << endl;
    return 0;
}

