#include "bits/stdc++.h"
using namespace std;

struct Num{
	vector<bool>potes;
	Num() :potes(256) {
	}
	Num(int l, int r):potes(256) {
		for (int i = l; i <= r; ++i) {
			potes[i] = true;
		}
	}
	Num operator +(const Num& r) {
		Num nnum;
		for (int i = 0; i < 256; ++i) {
			for (int j = 0; j < 256; ++j) {
				if (potes[i] && r.potes[j]) {
					nnum.potes[(i + j)%256] = true;
				}
			}
		}
		return nnum;
	}
	Num operator -(const Num& r) {
		Num nnum;
		for (int i = 0; i < 256; ++i) {
			for (int j = 0; j < 256; ++j) {
				if (potes[i] && r.potes[j]) {
					nnum.potes[(256+ i - j) % 256] = true;
				}
			}
		}
		return nnum;
	}
	Num operator *(const Num& r) {
		Num nnum;
		for (int i = 0; i < 256; ++i) {
			for (int j = 0; j < 256; ++j) {
				if (potes[i] && r.potes[j]) {
					nnum.potes[(i * j) % 256] = true;
				}
			}
		}
		return nnum;
	}
	Num operator /(const Num& r) {
		if (r.potes[0]) {
			throw(0);
		}
		Num nnum;
		for (int i = 0; i < 256; ++i) {
			for (int j = 0; j < 256; ++j) {

				if (potes[i] && r.potes[j]) {
					nnum.potes[(i / j) % 256] = true;
				}
			}
		}
		return nnum;
	}
};

map<string, Num>mp;

void input() {
	vector<Num>stack;
	int n; cin >> n;
	for (int i = 0; i < n; ++i) {
		string ch; cin >> ch;

		if (ch == "+"|| ch =="-"|| ch =="*"|| ch =="/") {
			Num b(stack.back());
			stack.pop_back();
			Num a(stack.back());
			stack.pop_back();
			Num next;
			if (ch == "+") {
				next = a+b;
			}
			if (ch == "-") {
				next =a-b;
			}
			if (ch == "*") {
				next =a*b;
			}
			if (ch == "/") {
				next = a/b;
			}
			stack.push_back(next);
		}
		else if (ch[0] >= '0'&&ch[0] <= '9') {
			int chnum = stoi(ch);
			Num anum(chnum, chnum);
			stack.push_back(anum);
		}
		else {
			stack.push_back(mp[ch]);
		}
	}
}

