#include <bits/stdc++.h>
#define MOD 256
using namespace std;

long long m, n;
vector<string> e;
map<string, set<int>> mp;
stack<set<int>> st;

bool solve();

int main() {
  cin >> m;
  for(int i = 0; i < m; ++i) {
    string s;
    int l, r;
    cin >> s >> l >> r;
    for(int i = l; i <= r; ++i) mp[s].insert(i);
  }
  cin >> n;
  e.resize(n);
  for(int i = 0; i < n; ++i) cin >> e[i];
  if(solve())
    cout << "correct" << endl;
  else
    cout << "error" << endl;
  return 0;
}

bool solve() {
  for(int i = 0; i < n; ++i) {
    set<int> a, b, c;
    if(e[i] == "+") {
      b = st.top();
      st.pop();
      a = st.top();
      st.pop();
      for(int x : a)
        for(int y : b) c.insert((x + y) % MOD);
      st.push(c);
    }
    else if(e[i] == "-") {
      b = st.top();
      st.pop();
      a = st.top();
      st.pop();
      for(int x : a)
        for(int y : b) c.insert((x - y + MOD) % MOD);
      st.push(c);
    }
    else if(e[i] == "*") {
      b = st.top();
      st.pop();
      a = st.top();
      st.pop();
      for(int x : a)
        for(int y : b) c.insert((x * y) % MOD);
      st.push(c);
    }
    else if(e[i] == "/") {
      b = st.top();
      st.pop();
      a = st.top();
      st.pop();
      for(int x : a)
        for(int y : b) {
          if(y == 0) return 0;
          c.insert((x / y) % MOD);
        }
      st.push(c);
    }
    else if(isdigit(e[i][0])) {
      a.insert(stoi(e[i]) % MOD);
      st.push(a);
    }
    else
      st.push(mp[e[i]]);
  }
  return 1;
}

