    map<string, bitset<256>> mp;
    for (int i = 0; i < m; ++i) {
        string s;
        int l, r;
        cin >> s >> l >> r;
        bitset<256> bs;
        for (int j = l; j <= r; ++j)
            bs.set(j);

        mp[s] = bs;
    }
    for (int i = 0; i < 256; ++i) {
        bitset<256> bs;
        bs.set(i);
        mp[to_string(i)] = bs;
    }
    cin >> n;
    stack<bitset<256>> st;
    for (int i = 0; i < n; ++i) {
        string s;
        cin >> s;
        switch (s[0]) {
            case '+':
            case '-':
            case '*':
            case '/':
            {
                bitset<256> b = st.top();
                st.pop();
                if (s[0] == '/' && b[0]) {
                    puts("error");
                    return 0;
                }
                bitset<256> a = st.top();
                st.pop();
                bitset<256> bs;
                for (int i = 0; i < 256; ++i) {
                    if (!a[i]) continue;
                    for (int j = 0; j < 256; ++j) {
                        if (!b[j]) continue;
                        switch (s[0]) {
                            case '+':
                                bs.set((i + j) % 256);
                                break;
                            case '-':
                                bs.set((i - j + 256) % 256);
                                break;
                            case '*':
                                bs.set((i * j) % 256);
                                break;
                            case '/':
                                bs.set((i / j) % 256);
                                break;
                        }
                    }
                }
                st.push(bs);
                break;
            }
            default:
                st.push(mp[s]);
                break;
        }
    }
    puts("correct");
    return 0;
}

