set<int> calc(set<int> a,set<int> b,string op)
{
	set<int> s;
	for(int x:a) for(int y:b){
		int z;
		switch(op[0]){
		case '*': z=x*y; break;
		case '+': z=x+y; break;
		case '-': z=x-y; break;
		case '/': if(y==0) throw "error"; else z=x/y;
		}
		while(z<0) z+=256;
		while(z>=256) z-=256;
		s.insert(z);
	}
	return s;
}

