using namespace std;
struct elem{
    bool isPossible[256];
    elem(){
        fill(isPossible,isPossible+256,false);
    }
    elem(int lb,int ub){
        fill(isPossible,isPossible+256,false);
        for(int i=lb;i<=ub;i++)isPossible[i]=true;
    }
};

int main(){
    int m;
    cin>>m;
    map<string,elem> M;
    for(int i=0;i<m;i++){
        string name;
        int lb,ub;
        cin>>name>>lb>>ub;
        M[name]=elem(lb,ub);
    }
    int n;
    cin>>n;
    stack<elem, vector<elem>> S;
    for(int i=0;i<n;i++){
        string str;
        cin>>str;
        stringstream ss(str);
        if('0'<=str[0]&&str[0]<='9'){
            int val;
            ss>>val;
            S.emplace(val,val);
            continue;
        }
        if(str[0]=='+'){
            elem B=S.top();S.pop();
            elem A=S.top();S.pop();
            elem C;
            for(int a=0;a<256;a++){
                if(A.isPossible[a]==false) continue;
                for(int b=0;b<256;b++){
                    C.isPossible[(uint8_t)(a+b)]=B.isPossible[b];
                }
            }
            S.push(C);
            continue;
        }
        if(str[0]=='-'){
            elem B=S.top();S.pop();
            elem A=S.top();S.pop();
            elem C;
            for(int a=0;a<256;a++){
                if(A.isPossible[a]==false) continue;
                for(int b=0;b<256;b++){
                    C.isPossible[(uint8_t)(a-b)]=B.isPossible[b];
                }
            }
            S.push(C);
            continue;
        }
        if(str[0]=='*'){
            elem B=S.top();S.pop();
            elem A=S.top();S.pop();
            elem C;
            for(int a=0;a<256;a++){
                if(A.isPossible[a]==false) continue;
                for(int b=0;b<256;b++){
                    C.isPossible[(uint8_t)(a*b)]=B.isPossible[b];
                }
            }
            S.push(C);
            continue;
        }
        if(str[0]=='/'){
            elem B=S.top();S.pop();
            elem A=S.top();S.pop();
            if(B.isPossible[0]){
                cout<<"error"<<endl;
                return 0;
            }
            elem C;
            for(int a=0;a<256;a++){
                if(A.isPossible[a]==false) continue;
                for(int b=1;b<256;b++){
                    C.isPossible[(uint8_t)a/(uint8_t)b]=B.isPossible[b];
                }
            }
            S.push(C);
            continue;
        }
        S.push(M[str]);
    }
    cout<<"correct"<<endl;
    return 0;
}

