bool isCorrect()
{
	constexpr int mod{1 << 8};
	std::map<std::string, std::pair<int, int>> lub;
	int m;
	scanf("%d", &m);
	for (int i{}; i < m; i++)
	{
		std::string name;
		int lb, ub;
		std::cin >> name >> lb >> ub;
		lub[name] = {lb, ub};
	}
	using i8b = std::array<bool, mod>;
	std::stack<i8b> st;
	int n;
	scanf("%d", &n);
	for (int i{}; i < n; i++)
	{
		std::string expression;
		std::cin >> expression;
		int size{(int)expression.size()};
		if (isdigit(expression.front()))
		{
			int num{std::stoi(expression)};
			i8b tmp{};
			tmp[num] = true;
			st.push(tmp);
		}
		else if (size == 1 && expression.front() == '+')
		{
			i8b next{};
			i8b rhs{st.top()};
			st.pop();
			i8b lhs{st.top()};
			st.pop();
			for (int i{}; i < mod; i++)
			{
				if (!lhs[i]) continue;
				for (int j{}; j < mod; j++)
				{
					if (!rhs[j]) continue;
					next[(i + j) % mod] = true;
				}
			}
			st.push(next);
		}
		else if (size == 1 && expression.front() == '-')
		{
			i8b next{};
			i8b rhs{st.top()};
			st.pop();
			i8b lhs{st.top()};
			st.pop();
			for (int i{}; i < mod; i++)
			{
				if (!lhs[i]) continue;
				for (int j{}; j < mod; j++)
				{
					if (!rhs[j]) continue;
					next[(i - j + mod) % mod] = true;
				}
			}
			st.push(next);
		}
		else if (size == 1 && expression.front() == '*')
		{
			i8b next{};
			i8b rhs{st.top()};
			st.pop();
			i8b lhs{st.top()};
			st.pop();
			for (int i{}; i < mod; i++)
			{
				if (!lhs[i]) continue;
				for (int j{}; j < mod; j++)
				{
					if (!rhs[j]) continue;
					next[(i * j) % mod] = true;
				}
			}
			st.push(next);
		}
		else if (size == 1 && expression.front() == '/')
		{
			i8b next{};
			i8b rhs{st.top()};
			st.pop();
			i8b lhs{st.top()};
			st.pop();
			if (rhs[0]) return false;
			for (int i{}; i < mod; i++)
			{
				if (!lhs[i]) continue;
				for (int j{}; j < mod; j++)
				{
					if (!rhs[j]) continue;
					next[i / j] = true;
				}
			}
			st.push(next);
		}
		else
		{
			i8b next{};
			int lb{lub[expression].first}, ub{lub[expression].second};
			for (int i{lb}; i <= ub; i++)
				next[i] = true;
			st.push(next);
		}
	}
	return true;
}

