        cin >> es[i];
    }
    // solve
    bool result = true;
    stack<bitset<256> > stk;
    for (string e : es) {
        if (isdigit(e[0])) {
            bitset<256> num = {};
            num[stoi(e)] = true;
            stk.push(num);
