#define REVERSE(v) reverse((v).begin(), (v).end())
typedef pair<int, int> P;

bool solve(vector<string> &ops, map<string, P> &vs){
  vector< vector<int> > v;
  for(string s : ops){
    vector<int> tmp;
    if(vs.find(s) != vs.end()) FOR(i, vs[s].first, vs[s].second + 1) tmp.push_back(i);
    else if(isdigit(s[0])) tmp.push_back(atoi(s.c_str()));
    else if(s == "+") {
      vector<int> b = v.back(); v.pop_back();
      vector<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          int n = x + y;
          while(n >= 256) n -= 256;
          tmp.push_back(n);
        }
      }
    } else if(s == "-"){
      vector<int> b = v.back(); v.pop_back();
      vector<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          int n = x - y;
          while(n < 0) n += 256;
          tmp.push_back(n);
        }
      }
    } else if(s == "*"){
      vector<int> b = v.back(); v.pop_back();
      vector<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          int n = x * y;
          while(n >= 256) n -= 256;
          tmp.push_back(n);
        }
      }
    } else if(s == "/"){
      vector<int> b = v.back(); v.pop_back();
      vector<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          if(y == 0) return false;
          int n = x / y;
          while(n >= 256) n -= 256;
          tmp.push_back(n);
        }
      }
    }
    v.push_back(tmp);
  }
  return true;
}

int main() {
  int M; cin >>M;
  map<string, P> vs;
  REP(i, M){
    string s; cin >>s;
    int l, u; cin >>l >>u;
    vs[s] = P(l, u);
  }
  int N; cin >>N;
  vector<string> ops(N);
  REP(i, N) cin >>ops[i];
  cout <<(solve(ops, vs) ? "correct" : "error")  <<endl;
  return 0;
}

