using namespace std;
typedef pair<int, int> P;

struct range{
	bool a[256];
	range(){
		for(int i = 0; i < 256; i++) a[i] = false;
	}
	range(int v){
		for(int i = 0; i < 256; i++) a[i] = (v == i);
	}
	range(int u, int v){
		for(int i = 0; i < 256; i++) a[i] = (i >= u && i <= v);
	}
	range operator+(const range& ope){
		range ret;
		for(int i = 0; i < 256; i++){
			for(int j = 0; j < 256; j++){
				if(this->a[i] && ope.a[j]) ret.a[(i+j)%256] = true;
			}
		}
		return ret;
	}
	range operator-(const range& ope){
		range ret;
		for(int i = 0; i < 256; i++){
			for(int j = 0; j < 256; j++){
				if(this->a[i] && ope.a[j]) ret.a[(i+256-j)%256] = true;
			}
		}
		return ret;
	}
	range operator*(const range& ope){
		range ret;
		for(int i = 0; i < 256; i++){
			for(int j = 0; j < 256; j++){
				if(this->a[i] && ope.a[j]) ret.a[(i*j)%256] = true;
			}
		}
		return ret;
	}
	range operator/(const range& ope){
		range ret;
		for(int i = 0; i < 256; i++){
			for(int j = 0; j < 256; j++){
				if(this->a[i] && ope.a[j]) ret.a[(i/j)%256] = true;
			}
		}
		return ret;
	}

};

int m, n;
map<string, range> mp;
stack<range> stk;

int main(void)
{
	cin >> m;

	range tmp;
	string name; int lb, ub;

	for(int i = 0; i < m; i++){
		cin >> name >> lb >> ub;
		for(int j = 0; j < 256; j++){
			mp[name] = range(lb, ub);
		}
	}

	string s;
	range ope1, ope2;
	bool ans = true;

	cin >> n;
	for(int i = 0; i < n; i++){
		cin >> s;

		int v = atoi(s.c_str());
		if(v != 0) stk.push(range(v));
		else if(v == 0 && s == "0") stk.push(range(0));
		else{

			if(s == "+"){
				ope2 = stk.top(); stk.pop();
				ope1 = stk.top(); stk.pop();
				stk.push(ope1 + ope2);
			}else if(s == "-"){
				ope2 = stk.top(); stk.pop();
				ope1 = stk.top(); stk.pop();
				stk.push(ope1 - ope2);
			}else if(s == "*"){
				ope2 = stk.top(); stk.pop();
				ope1 = stk.top(); stk.pop();
				stk.push(ope1 * ope2);
			}else if(s == "/"){
				ope2 = stk.top();
				if(ope2.a[0]){
					ans = false;
					goto end;
				}
				stk.pop();
				ope1 = stk.top(); stk.pop();
				stk.push(ope1 / ope2);
			}else{
				stk.push( mp[s] );
			}
		}

	}

	end:;
	if(ans) cout << "correct" << endl;
	else cout << "error" << endl;

	return 0;
}

