#include <bits/stdc++.h>

using namespace std;

#define MAX 300
typedef pair<int, int> pii;

int n;
vector<string> e;
map<string, pii> mp;

int op_num(char c)
{
    switch (c) {
        case '+':
            return 0;
        case '-':
            return 1;
        case '*':
            return 2;
        case '/':
            return 3;
    }
    return -1;
}

int s2i(string &s)
{
    int res;
    stringstream ss(s);
    ss >> res;
    return res;
}

int memo[MAX][MAX][MAX];

bool zero_division_checker(int x, vector<int> vec)
{
    if (x == n) {
        return true;
    }
    int l = vec.size();
    int v  = (l-2 < 0 ? MAX-1 : vec[l-2]);
    int v2 = (l-1 < 0 ? MAX-1 : vec[l-1]); 
    if (memo[x][v][v2] != -1) {
        return memo[x][v][v2];
    }
    bool res = 1;
    if (isdigit(e[x][0])) {
        vec.push_back(s2i(e[x]));
        res = zero_division_checker(x+1, vec);
        vec.pop_back();
    } else {
        int op = op_num(e[x][0]);
        if (op >= 0) {
            if (l < 2) {
                return false;
            }
            int b = vec[l-1];
            int a = vec[l-2];
            vec.pop_back(); vec.pop_back();

            int c = -1;
            if (op == 0) {
                c = (a + b) % 256;
            } else if (op == 1) {
                c = (a - b + 256) % 256;
            } else if (op == 2) {
                c = (a * b) % 256;
            } else {
                if (b == 0) {
                    return false;
                }
                c = (a / b) % 256;
            }
            vec.push_back(c);
            res = zero_division_checker(x+1, vec);
            vec.pop_back();
            vec.push_back(a);
            vec.push_back(b);
        } else {
            pii p = mp[e[x]];
            for (int i = p.first; i <= p.second; i++) {
                vec.push_back(i);
                res &= zero_division_checker(x+1, vec);
                vec.pop_back();
            }
        }
    }
    return (memo[x][v][v2] = res);
}

