int op_num(char c)
{
    switch (c) {
        case '+':
            return 0;
        case '-':
            return 1;
        case '*':
            return 2;
        case '/':
            return 3;
    }
    return -1;
}

int s2i(string &s)
{
    int res;
    stringstream ss(s);
    ss >> res;
    return res;
}

int memo[MAX][MAX][MAX];

bool zero_division_checker(int x, vector<pii> vec)
{
    if (x == n) {
        return true;
    }
    int l = vec.size();
    int v  = (l == 0 ? MAX-1 : vec[0].second);
    int v2 = (l == 0 ? MAX-1 : vec[l-1].second); 
    if (memo[x][v][v2] != -1) {
        return memo[x][v][v2];
    }
    bool res = 1;
    if (isdigit(e[x][0])) {
        vec.push_back(pii(s2i(e[x]), x));
        res = zero_division_checker(x+1, vec);
        vec.pop_back();
    } else {
        int op = op_num(e[x][0]);
        if (op >= 0) {
            pii p2 = vec[l-1], p1 = vec[l-2];
            int b = p2.first;
            int a = p1.first;
            vec.pop_back(); vec.pop_back();

            int c = -1;
            if (op == 0) {
                c = (a + b) % 256;
            } else if (op == 1) {
                c = (a - b + 256) % 256;
            } else if (op == 2) {
                c = (a * b) % 256;
            } else {
                if (b == 0) {
                    return false;
                }
                c = (a / b) % 256;
            }
            vec.push_back(pii(c, x));
            res = zero_division_checker(x+1, vec);
            vec.pop_back();
            vec.push_back(p1);
            vec.push_back(p2);
        } else {
            pii p = mp[e[x]];
            for (int i = p.first; i <= p.second; i++) {
                vec.push_back(pii(i, x));
                res &= zero_division_checker(x+1, vec);
                vec.pop_back();
            }
        }
    }
    return (memo[x][v][v2] = res);
}

