using namespace std;

range range_add(range a, range b){
    range ret(256,0);
    int i,j;
    for(i=a.first;i<=a.second;i++){
        for(j=b.first;j<=b.second;j++){
            ret.first=(ret.first<(i+j)%256)?ret.first:(i+j)%256;
            ret.second=(ret.second>(i+j)%256)?ret.second:(i+j)%256;
        }
    }
    return ret;
}

range range_dif(range a, range b){
    range ret(256,0);
    int i,j;
    for(i=a.first;i<=a.second;i++){
        for(j=b.first;j<=b.second;j++){
            ret.first=(ret.first<(i+256-j)%256)?ret.first:(i+256-j)%256;
            ret.second=(ret.second>(i+256-j)%256)?ret.second:(i+256-j)%256;
        }
    }
    return ret;
}

range range_mul(range a, range b){
    range ret(256,0);
    int i,j;
    for(i=a.first;i<=a.second;i++){
        for(j=b.first;j<=b.second;j++){
            ret.first=(ret.first<(i*j)%256)?ret.first:(i*j)%256;
            ret.second=(ret.second>(i*j)%256)?ret.second:(i*j)%256;
        }
    }
    return ret;
}

range range_div(range a, range b){
    range ret(256,0);
    int i,j;
    for(i=a.first;i<=a.second;i++){
        for(j=b.first;j<=b.second;j++){
            if(j==0){
                throw 1;
            }
            ret.first=(ret.first<(i/j)%256)?ret.first:(i/j)%256;
            ret.second=(ret.second>(i/j)%256)?ret.second:(i/j)%256;
        }
    }
    return ret;
}

