typedef vector<int> Number;

Number add(Number &a, Number &b) {
  Number res(256);

  for (int i=0; i<256; i++)
    for (int j=0; j<256; j++)
      if (a[i] && b[j]) res[(i+j)%256] = 1;

  return res;
}

Number sub(Number &a, Number &b) {
  Number res(256);

  for (int i=0; i<256; i++)
    for (int j=0; j<256; j++)
      if (a[i] && b[j]) res[(i-j+256)%256] = 1;

  return res;
}

Number mul(Number &a, Number &b) {
  Number res(256);

  for (int i=0; i<256; i++)
    for (int j=0; j<256; j++)
      if (a[i] && b[j]) res[(i*j)%256] = 1;

  return res;
}

Number div(Number &a, Number &b) {
  Number res(256);

  if (b[0]) {
    puts("error");
    exit(0);
  }

  for (int i=0; i<256; i++)
    for (int j=0; j<256; j++)
      if (a[i] && b[j]) res[(i/j)%256] = 1;

  return res;
}

bool isNumber(string s) {
  for(char c : s) {
    if (!isdigit(c)) return false;
  }
  return true;
}

Number create(int l, int r) {
  Number res(256);
  for (int i=l; i<=r; i++) res[i] = 1;
  return res;
}


