#include <bits/stdc++.h>
using namespace std;

map<string,set<int> > mp;

string random2(){
	string w;
	for(int i = 0 ; i < 100 ; i++)
		w += rand() % 26 + 'a';
	return w;
}

string itos(int n){
	stringstream ss;
	ss << n;
	return ss.str();
}
bool inte(string s){
	return '0' <= s[0] && s[0] <= '9';
}
bool ope(string s){
	return s == "+" || s == "*" || s == "/" || s == "-";
}
bool var(string s){
	return !inte(s) && !ope(s);
}
set<int> val(string s){
	if( inte(s) ) return set<int>{atoi(s.c_str())};
	return mp[s];
}
set<int> operator + (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A+B)%256);
		}
	}
	return C;
}
set<int> operator / (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A/B)%256);
		}
	}
	return C;
}

set<int> operator * (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A*B)%256);
		}
	}
	return C;
}

set<int> operator - (set<int> a,set<int> b){
	set<int> C;
	for( auto A : a ){
		for( auto B : b ){
			C.insert((A-B+256)%256);
		}
	}
	return C;
}



bool calc(vector<string> e){
	stack<string> s;
	for( int i = 0 ; i < e.size() ; i++){
	  if( inte(e[i]) ){
		s.push(e[i]);
	  }
	  if( var(e[i]) ){
		s.push(e[i]);
	  }
	  if( ope(e[i]) ){
		string b = s.top(); s.pop();
		string a = s.top(); s.pop();
		set<int> B = val(b);
		set<int> A = val(a);
		set<int> R;
		if( e[i] == "+" ){
			R = A+B;
		}else if( e[i] == "-" ){
			R = A-B;
		}else if( e[i] == "*" ){
			R = A*B;
		}else if( e[i] == "/" ){
			if( B.count(0) ) return 0;
			R = A/B;
		}
		string name = random2();
		mp[name] = R;
		s.push(name);
	  }
	}
	return 1;
}

