typedef pair<int, int> P;

bool solve(vector<string> &ops, map<string, P> &vs){
  vector< set<int> > v;
  for(string s : ops){
    set<int> tmp;
    if(vs.find(s) != vs.end()) FOR(i, vs[s].first, vs[s].second + 1) tmp.insert(i);
    else if(isdigit(s[0])) tmp.insert(atoi(s.c_str()));
    else if(s == "+") {
      set<int> b = v.back(); v.pop_back();
      set<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          int n = x + y;
          while(n >= 256) n -= 256;
          tmp.insert(n);
        }
      }
    } else if(s == "-"){
      set<int> b = v.back(); v.pop_back();
      set<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          int n = x - y;
          while(n < 0) n += 256;
          tmp.insert(n);
        }
      }
    } else if(s == "*"){
      set<int> b = v.back(); v.pop_back();
      set<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          int n = x * y;
          while(n >= 256) n -= 256;
          tmp.insert(n);
        }
      }
    } else if(s == "/"){
      set<int> b = v.back(); v.pop_back();
      set<int> a = v.back(); v.pop_back();
      for(int x : a){
        for(int y : b){
          if(y == 0) return false;
          int n = x / y;
          while(n >= 256) n -= 256;
          tmp.insert(n);
        }
      }
    }
    v.push_back(tmp);
  }
  return true;
}

