typedef pair<llint, llint> P;

struct A{
	bool a[256];
	A(){
		for(int i = 0; i < 256; i++) a[i] = false;
	}
	A(llint x){
		for(int i = 0; i < 256; i++) a[i] = false;
		a[x] = true;
	}
};

llint m, n;
map<string, P> mp;
stack<A> stk;

A add(A a, A b)
{
	A ret;
	for(int i = 0; i < 256; i++){
		for(int j = 0; j < 256; j++){
			if(a.a[i] && b.a[j]) ret.a[(i+j)%256] = true;
		}
	}
	return ret;
}
A sub(A a, A b)
{
	A ret;
	for(int i = 0; i < 256; i++){
		for(int j = 0; j < 256; j++){
			if(a.a[i] && b.a[j]) ret.a[(i-j+256)%256] = true;
		}
	}
	return ret;
}
A mul(A a, A b)
{
	A ret;
	for(int i = 0; i < 256; i++){
		for(int j = 0; j < 256; j++){
			if(a.a[i] && b.a[j]) ret.a[(i*j)%256] = true;
		}
	}
	return ret;
}
A divi(A a, A b)
{
	A ret;
	for(int i = 0; i < 256; i++){
		for(int j = 0; j < 256; j++){
			if(a.a[i] && b.a[j]) ret.a[(i/j)%256] = true;
		}
	}
	return ret;
}

