		else if(s == "-"){
			A b = stk.top(); stk.pop();
			A a = stk.top(); stk.pop();
			stk.push(sub(a, b));
		}
		else if(s == "*"){
			A b = stk.top(); stk.pop();
			A a = stk.top(); stk.pop();
			stk.push(mul(a, b));
