struct Number{
  vector<int> cand;
  Number(int s, int e){
    for(int i = s; i <= e; i++)
      cand.push_back(i);
  }
  Number(int n){
    cand.push_back(n);
  }
  Number(){}
};

Number operator + (const Number &lhs, const Number &rhs){
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    ret.cand.push_back((lhs.cand[i] + rhs.cand[j]) % 256);
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.end()), ret.cand.end());
  }
  return ret;
}

Number operator - (const Number &lhs, const Number &rhs){
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    ret.cand.push_back((lhs.cand[i] - rhs.cand[j] + 256) % 256);
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.end()), ret.cand.end());
  }
  return ret;
}

Number operator * (const Number &lhs, const Number &rhs){
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    ret.cand.push_back((lhs.cand[i] * rhs.cand[j]) % 256);
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.end()), ret.cand.end());
  }
  return ret;
}

Number operator / (const Number &lhs, const Number &rhs){
  Number ret;
  REP(i,lhs.cand.size()) REP(j,rhs.cand.size()){
    if(rhs.cand[j] == 0) throw 0;
    ret.cand.push_back((lhs.cand[i] / rhs.cand[j]) % 256);
    sort(ret.cand.begin(), ret.cand.end());
    ret.cand.erase(unique(ret.cand.begin(), ret.cand.end()), ret.cand.end());
  }
  return ret;
}

