fn operate(a: &[bool; 256], b: &[bool; 256], op: char) -> Option<[bool; 256]> {
    let mut ans = [false; 256];
    macro_rules! exhaust {
        ($op:expr) => {
            for i in 0 .. 256 {
                if a[i] {
                    for j in 0 .. 256 {
                        if b[j] {
                            ans[$op(i, j)] = true;
                        }
                    }
                }
            }
        };
    }
    match op {
        '+' => exhaust!(|i, j| (i + j) % 256),
        '-' => exhaust!(|i, j| (i + 256 - j) % 256),
        '*' => exhaust!(|i, j| (i * j) % 256),
        '/' => {
            if b[0] {
                return None;
            }
            exhaust!(|i, j| i / j);
        },
        _ => panic!(),
    }
    Some(ans)
}

