// 0 
bool flag = false;

// string -> int
int s_to_i(string s){
	int n = 0;
	for(int i=0 ; i < s.size() ; i++ ){
		n *= 10;
		n += s[i] - '0';
	}
	return n;
}

// int -> string
string i_to_s(int n){
	string s;
	do{
		s.push_back( (n%10) + '0' );
		n /= 10;
	}while(n!=0);
	reverse(s.begin(),s.end());
	return s;
}

// .
bool is_op(const string& s){
	return ( s == "+" || s == "-" || s == "*" || s == "/" );
}

// .
bool is_number(const string& s){
	return ( '0' <= s[0] && s[0] <= '9' );
}

// a op b . 0.
int op(int a, int b, char op){
	int r;
	// 0 
	if( b == 0 && op == '/' ){
		flag = true;
		return 0;
	}
	// 
	if( op == '+' ){
		r = ( a + b ) % 256;
	}else if( op == '-' ){
		r = ( a - b + 256 ) % 256;
	}else if( op == '*' ){
		r = ( a * b ) % 256;
	}else if( op == '/' ){
		r = ( a / b ) % 256;
	}

	return r;
}

