	for(int i = 0 ; i < n ; i++ ){
		cin >> e[i];
	}
	for(int i = 0 ; i < n ; i++ ){
		// 0 
		if( flag ){
			break;
		}
		if( is_number(e[i]) ){ // e[i] 
			set<int> s;
			s.insert(s_to_i(e[i]));
			st.push(s);
		}else if( is_op(e[i]) ){ // e[i] 
			set<int> b = st.top();
			st.pop();
			set<int> a = st.top();
			st.pop();

			set<int> next;

			//  ([0,255])
			for(set<int>::iterator x = b.begin() ; x != b.end() ; ++x ){
				for(set<int>::iterator y = a.begin() ; y != a.end() ; ++y ){
					int r = op( *y, *x , e[i][0] );
					next.insert(r);
				}
			}
			st.push(next);

		}else{ // e[i] 
			int l = value[e[i]].first;
			int r = value[e[i]].second;
			set<int> next;

			// {l, l+1, ... , r } 
			for(int i = l ; i <= r ; i++ ){
				next.insert(i);
			}
			st.push(next);
		}
	}
	// 
	if( !flag ){
		cout << "correct" << endl;
	}else{
		cout << "error" << endl;
	}	
}

