{
    int m;
    cin >> m;
    string name;
    int lb, ub;
    for (int i = 0; i < m; i++) {
        cin >> name >> lb >> ub;
        mp[name] = pii(lb, ub);
    }
    cin >> n;
    e.resize(n);
    for (int i = 0; i < n; i++) {
        cin >> e[i];
    }
    memset(memo, -1, sizeof(memo));
    cout << (zero_division_checker(0, vector<int>()) ? "correct" : "error") << endl;
    return 0;
}

