        st.pop();
    } else {
        int op = op_num(e[x][0]);
        if (op >= 0) {
            int b = st.top(); st.pop();
            int a = st.top(); st.pop();
            if (op == 0) {
                a = (a + b) % 256;
            } else if (op == 1) {
