    unordered_map<string, pair<int,int>> ma;
    pararell_input(m, c, l, r);
    for(auto& x : r)
        ++x;
    for(int i = 0; i < m; ++i)
        ma[c[i]] = make_pair(l[i], r[i]);
    int n;
    input(n);
