    stack<bs> st;

    for(int i = 0; i < n; ++i){
        if(ma.find(v[i]) != ma.end()){
            bs s;
            auto p = ma[v[i]];
            for(int j = p.first; j < p.second; ++j)
                s.set(j);
            st.push(s);
        }else if(find(op.begin(), op.end(), v[i]) != op.end()){

            if(st.size() < 2){
                cout << "error" << endl;
                return 0;
            }
            bs b = st.top();
            st.pop();
            bs a = st.top();
            st.pop();

            bs ans;

            for(int j = 0; j < 256; ++j)
                for(int k = 0; k < 256; ++k){
                    if(!a[j] || !b[k])
                        continue;
                    if(v[i] == "+"){
                        int val = (j + k) % 256;
                        ans.set(val);
                    }
                    if(v[i] == "-"){
                        int val = (j - k + 256) % 256;
                        ans.set(val);
                    }
                    if(v[i] == "*"){
                        int val = (j * k) % 256;
                        ans.set(val);
                    }
                    if(v[i] == "/"){
                        if(k == 0){
                            cout << "error" << endl;
                            return 0;
                        }
                        int val = j / k;
                        ans.set(val);
                    }
                }

            st.push(ans);

        }else{
            int val = stoi(v[i]);
            bs s;
            s.set(val);
            st.push(s);
        }
    }

    if(st.size() == 1)
        cout << "correct" << endl;
    else
        cout << "error" << endl;

    return false;
}

