    if (isdigit(e[i][0])) {
      dp[i][i][stoi(e[i])] = 1;
      st.emplace(i, i);
    } else if (isalpha(e[i][0])) {
      pii r = mp[e[i]];
      for (int j = 0; j < 256; j++) {
        dp[i][i][j] = (r.first <= j && j <= r.second);
      }
      st.emplace(i, i);
    } else {
      if (st.size() < 2) {
        cout << "error" << endl;
        return 0;
