        for (int j = 0; j < 256; j++) {
          for (int k = 0; k < 256; k++) {
            dp[a.first][i][(j+k)%256] |= (dp[a.first][a.second][j] && dp[b.first][b.second][k]);
          }
        }
      } else if (e[i] == "-") {
        for (int j = 0; j < 256; j++) {
          for (int k = 0; k < 256; k++) {
            dp[a.first][i][(j-k+256)%256] |= (dp[a.first][a.second][j] && dp[b.first][b.second][k]);
