bool calc(int op) {
    string a, b;
    a = q.back(), q.pop_back();
    b = q.back(), q.pop_back();
    bool aa = isDigit(a), bb = isDigit(b);
    if (aa && bb) {
        if (op == 0) q.push_back(to_string((stoi(a) + stoi(b)) % MOD));
        else if (op == 1) q.push_back(to_string((stoi(a) - stoi(b) + MOD) % MOD));
        else if (op == 2) q.push_back(to_string((stoi(a) * stoi(b)) % MOD));
        else {
            if (stoi(b) != 0) q.push_back(to_string((stoi(a) / stoi(b)) % MOD));
            else return false;
        }
    } else if (!aa && !bb) {
        S c;
        if (op == 0) each(i, mp[a])each(j, mp[b]) c.insert((i + j) % MOD);
        else if (op == 1) each(i, mp[a])each(j, mp[b]) c.insert((i - j + MOD) % MOD);
        else if (op == 2) each(i, mp[a])each(j, mp[b]) c.insert((i * j) % MOD);
        else  each(i, mp[a])each(j, mp[b]) {
            if (j != 0) c.insert((i / j) % MOD);
            else return false;
        }
        string newStr('a', nameLength++);
        q.push_back(newStr);
        mp[newStr] = c;
    } else {
        if (!aa) swap(a, b);
        S c;
        int d = stoi(a);
        if (op == 0) each(i, mp[b]) c.insert((d + i) % MOD);
        else if (op == 1) each(i, mp[b]) c.insert((d - i + MOD) % MOD);
        else if (op == 2) each(i, mp[b]) c.insert((d * i) % MOD);
        else each(i, mp[b]) {
            if (i != 0) c.insert((d / i) % MOD);
            else return false;
        }
        string newStr('a', nameLength++);
        q.push_back(newStr);
        mp[newStr] = c;
    }
    return true;
}

bool decode(string s) {
    bool ret = true;
    if (s[0] == '+') {
        ret = calc(0);
    } else if (s[0] == '-') {
        ret = calc(1);
    } else if (s[0] == '*') {
        ret = calc(2);
    } else if (s[0] == '/') {
        ret = calc(3);
    } else {
        q.push_back(s);
    }
    return ret;
}

