set<pii> mergeSegment(const set<pii>& st) {
	set<pii> ret;
	if(st.size() == 0) return ret;
	auto p = *st.begin();
	auto it = st.begin();
	it++;
	while(it != st.end()) {
		auto tmp = *it;
		if(p.se >= tmp.fi) {
			p.fi = min(p.fi, tmp.fi);
			p.se = max(p.se, tmp.se);
		}
		else{
			ret.insert(p);
			p = tmp;
		}
		it++;
	}
	ret.insert(p);
	return ret;
}
