	vector<bool> c(256);
	for (int i = 0; i < 256; i++)
		for (int j = 0; j < 256; j++)
			if (a[i] && b[j])
				c[(i + j) % 256] = true;
	return c;
}

vector<bool> sub(vector<bool>& a, vector<bool>& b) {
	vector<bool> c(256);
	for (int i = 0; i < 256; i++)
		for (int j = 0; j < 256; j++)
			if (a[i] && b[j])
				c[(i - j + 256) % 256] = true;
	return c;
}

vector<bool> mul(vector<bool>& a, vector<bool>& b) {
	vector<bool> c(256);
	for (int i = 0; i < 256; i++)
		for (int j = 0; j < 256; j++)
			if (a[i] && b[j])
				c[(i * j) % 256] = true;
	return c;
