bool calc(set<int>& B,set<int>& A,string ope,stack<set<int> >& ele)
{
  set<int> C;
  for(set<int>::iterator it_B = B.begin();it_B != B.end();it_B++)
    {
      for(set<int>::iterator it_A = A.begin();it_A != A.end();it_A++)
	{
	  if(ope == "+")
	    {
	      C.insert(((*it_A)+(*it_B))%256);
	    }
	  else if(ope == "-")
	    {
	      C.insert(((*it_A)-(*it_B)+256)%256);
	    }
	  else if(ope == "*")
	    {
	      C.insert(((*it_A)*(*it_B))%256);
	    }
	  else if(ope == "/")
	    {
	      if(!(*it_B))
		{

		  return false; 
		}
	      C.insert(((*it_A)/(*it_B))%256);
	    }
	  else 
	    assert(false);
	}
    }
  ele.push(C);
  return true;
}

