}

struct uplow bin_operator(struct uplow arg1,struct uplow arg2,char op)
{
  struct uplow ret;
  int i,j;
  unsigned char res;

  if(op=='/' && is_val(arg2,0)) //div by zero
    longjmp(jb,1);
  clear_val(&ret);

  for(i=0;i<256;i++)
    if(is_val(arg1,(unsigned char)i))
      for(j=0;j<256;j++)
	if(is_val(arg2,(unsigned char)j))
	  {
	    if(op=='+')
	      res=i+j;
	    else if(op=='-')
	      res=i-j;
	    else if(op=='*')
	      res=i*j;
	    else if(op=='/')
	      res=i/j;
	    set_val(&ret,res);
	  }
  return(ret);
}

