public class Main {
	InputStream is;

	boolean __FILE_DEBUG_FLAG__ = false;
	String __DEBUG_FILE_NAME__ = "src/T2";

	FastScanner in;
	PrintWriter out;

	boolean ans = true;

	class Elem {
		boolean[] can = new boolean[256];

		Elem() { }

		Elem(int lower, int upper) {
			for (int i = lower; i <= upper; i++) {
				can[i%256] = true;
			}
		}

		void set(int x) {
			can[x%256] = true;
		}

		Elem add(Elem e) {
			Elem res = new Elem();
			for (int i = 0; i < 256; i++) {
				if (!can[i]) continue;
				for (int j = 0; j < 256; j++) {
					if (!e.can[j]) continue;
					res.set(i+j);
				}
			}
			return res;
		}

		Elem sub(Elem e) {
			Elem res = new Elem();
			for (int i = 0; i < 256; i++) {
				if (!can[i]) continue;
				for (int j = 0; j < 256; j++) {
					if (!e.can[j]) continue;
					res.set(i-j+256);
				}
			}
			return res;
		}

		Elem mult(Elem e) {
			Elem res = new Elem();
			for (int i = 0; i < 256; i++) {
				if (!can[i]) continue;
				for (int j = 0; j < 256; j++) {
					if (!e.can[j]) continue;
					can[(i*j) % 256] = true;
					res.set(i*j);
				}
			}
			return res;
		}

		Elem div(Elem e) {
			Elem res = new Elem();
			for (int i = 0; i < 256; i++) {
				if (!can[i]) continue;
				for (int j = 0; j < 256; j++) {
					if (!e.can[j]) continue;
					if (j == 0) {
						ans = false; 
					} else {
						res.set(i/j);
					}
				}
			}
			return res;
		}
	}

	public void solve() {	
		int n = in.nextInt();
		HashMap<String, Elem> map = new HashMap<String, Elem>();
		for (int i = 0; i < n; i++) {
			String name = in.next();
			int lower = in.nextInt(), upper = in.nextInt();
			map.put(name, new Elem(lower, upper));
		}

		int m = in.nextInt();
		Stack<Elem> stack = new Stack<Elem>();
		for (int i = 0; i < m; i++) {
			String next = in.next();
			char c = next.charAt(0);
			if (c == '+') {
				Elem e1 = stack.pop();
				Elem e2 = stack.pop();
				stack.push(e2.add(e1));
			} else if (c == '-') {
				Elem e1 = stack.pop();
				Elem e2 = stack.pop();
				stack.push(e2.sub(e1));				
			} else if (c == '*') {
				Elem e1 = stack.pop();
				Elem e2 = stack.pop();
				stack.push(e2.mult(e1));				
			} else if (c == '/') {
				Elem e1 = stack.pop();
				Elem e2 = stack.pop();
				stack.push(e2.div(e1));
				if (!ans) break;
			} else if (Character.isDigit(c)) {
				int val = Integer.valueOf(next);
				stack.push(new Elem(val, val));
			} else if (Character.isLetter(c)) {
				stack.push(map.get(next));
			}
		}

		System.out.println(ans ? "correct" : "error");
	}


	public void run() {
		if (__FILE_DEBUG_FLAG__) {
			try {
				is = new FileInputStream(__DEBUG_FILE_NAME__);
			} catch (FileNotFoundException e) {
