			if ("+-*/".contains(e)) {
				Exp a, b;
				b = stack.pop();
				a = stack.pop();
				switch (e) {
					case "+":
						stack.push(main.new Bino(a, b, main.new Add()));
						break;
					case "-":
						stack.push(main.new Bino(a, b, main.new Subtract()));
						break;
					case "*":
						stack.push(main.new Bino(a, b, main.new Multiply()));
						break;
					case "/":
						stack.push(main.new Bino(a, b, main.new Divide()));
						break;
				}
			} else {
				if (vars.containsKey(e)) {
					stack.push(vars.get(e));
				} else {
					stack.push(main.new Mono(parseInt(e)));
				}
			}
		}

		//solve
		Exp exp = stack.pop();
		try {
			exp.eval();
			System.out.println("correct");
		} catch (ArithmeticException ex) {
			System.out.println("error");
		}
	}

	//Element
	interface Elm {
	}

	//Operator
	interface Op extends Elm {
		int eval(int a, int b);
	}

	class Add implements Op {
		@Override
		public int eval(int a, int b) {
			return (a + b) % 256;
		}
	}

	class Subtract implements Op {
		@Override
		public int eval(int a, int b) {
			return (a - b + 256) % 256;
		}
	}

	class Multiply implements Op {
		@Override
		public int eval(int a, int b) {
			return (a * b) % 256;
		}
	}

	class Divide implements Op {
		@Override
		public int eval(int a, int b) {
			return (a / b) % 256;
		}
	}

	//
	interface Exp extends Elm {
		Exp eval();

		int lb();

		int ub();
	}

	class Mono implements Exp {
		int lb, ub;

		Mono(int lb) {
			this(lb, lb);
		}

		Mono(int lb, int ub) {
			this.lb = lb;
			this.ub = ub;
		}

		public Mono eval() {
			return this;
		}

		public int lb() {
			return lb;
		}

		public int ub() {
			return ub;
		}
	}

	class Bino implements Exp {
		int lb, ub;
		Exp a, b;
		Op op;

		Bino(Exp a, Exp b, Op op) {
			this.a = a;
			this.b = b;
			this.op = op;
		}

		public Exp eval() {

			if (a instanceof Bino) a.eval();
			if (b instanceof Bino) b.eval();

			int alb, aub;
			int blb, bub;
			alb = a.lb();
			aub = a.ub();
			blb = b.lb();
			bub = b.ub();

			for (int i = alb; i <= aub; i++) {
				for (int j = blb; j <= bub; j++) {
					int r = op.eval(i, j);
					lb = Math.min(lb, r);
					ub = Math.max(ub, r);
				}
			}
			return new Mono(lb, ub);
		}

		public int lb() {
			return lb;
		}

		public int ub() {
			return ub;
		}
	}
}

